import React from 'react';
import { Route, Switch } from 'react-router-dom';
import { Login } from './components/home';

export default class App extends React.Component {

    render() {
        return (
            <Switch>
                <Route exact path='/' component={Login} />
            </Switch>
        );
    }
}
